var font =
  "";

var fontBold =
  "";

var fontItalic =
  "";

export function registerFonts(jsPDFAPI) {
  var callAddFont = function () {
    this.addFileToVFS("LiberationSans-BaDn-normal.ttf", font);
    this.addFont(
      "LiberationSans-BaDn-normal.ttf",
      "LiberationSans-BaDn",
      "normal"
    );
  };
  var callAddFontBold = function () {
    this.addFileToVFS("LiberationSans-BaDn-bold.ttf", fontBold); 
    this.addFont("LiberationSans-BaDn-bold.ttf", "LiberationSansBold", "bold");
  };

  var callAddFontItalic = function () {
    this.addFileToVFS("LiberationSansItalic-RJre-italic.ttf", fontItalic);
    this.addFont(
      "LiberationSansItalic-RJre-italic.ttf",
      "LiberationSansItalic-RJre",
      "italic"
    );
  };
  jsPDFAPI.events.push(["addFonts", callAddFont]);
  jsPDFAPI.events.push(["addFonts", callAddFontBold]);
  jsPDFAPI.events.push(["addFonts", callAddFontItalic]);
}
